import React from 'react';
import Track from '../Track/Track';
import styles from './Tracklist.module.css';

let trackExample = {
    title: 'Despasito',
    artist : 'Sergio Leone',
};


const tracklistExample = [trackExample,trackExample,trackExample,trackExample];

function Tracklist(props) {
    return (
        <div className={styles.TracklistContainer}>

           {props.tracklistExample.map((track,index) => <Track trackData={track} key={index} />)} 

        </div>
    )
}


export default Tracklist;



